import React from 'react';
import { reduxForm, Field } from 'redux-form';

const StreamCreate = () => {
	return (
		<form>
			<div className='form-group'>
				<Field />
				<Field />
			</div>
		</form>
	);
};
export default reduxForm({
	form: 'streamCreate',
})(StreamCreate);
